webpackJsonp([0x7c396164df958c00],{"./node_modules/json-loader/index.js!./.cache/json/css-properties-clear-property.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h2>Clear Property</h2>\n<p>You can use the <code>clear</code> property to push down an element, preventing it from appearing next to the precedent floated element.</p>\n<p>The <code>clear</code> property can have the following values:</p>\n<p>This property is used after the <code>float</code> property is used to “clear” out the <code>float</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code><span class="token property">clear</span><span class="token punctuation">:</span> none<span class="token punctuation">;</span>\n<span class="token property">clear</span><span class="token punctuation">:</span> left<span class="token punctuation">;</span>\n<span class="token property">clear</span><span class="token punctuation">:</span> right<span class="token punctuation">;</span>\n<span class="token property">clear</span><span class="token punctuation">:</span> both<span class="token punctuation">;</span>\n<span class="token property">clear</span><span class="token punctuation">:</span> inline-start<span class="token punctuation">;</span>\n<span class="token property">clear</span><span class="token punctuation">:</span> inline-end<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3>Example:</h3>\n<p><img src="https://image.ibb.co/defebR/clear.png" alt="Clear Property Image" title="Clear Property"></p>\n<p>In the example above, the yellow <code>div</code> has the property <code>float:left</code>, and could fit under the coral <code>div</code>. However, as the yellow <code>div</code> has also the property <code>clear: both</code>, it moves down below the floated elements.</p>\n<h4>More Information:</h4>\n<ul>\n<li><a href="https://css-tricks.com/almanac/properties/c/clear/">https://css-tricks.com/almanac/properties/c/clear/</a></li>\n<li><a href="https://www.w3schools.com/cssref/pr_class_clear.asp">https://www.w3schools.com/cssref/pr<em>class</em>clear.asp</a></li>\n<li><a href="https://developer.mozilla.org/en-US/docs/Web/CSS/clear">https://developer.mozilla.org/en-US/docs/Web/CSS/clear</a></li>\n</ul>',fields:{slug:"/css/properties/clear-property/"},frontmatter:{title:"Clear Property"}}},pathContext:{slug:"/css/properties/clear-property/"}}}});
